import React from 'react';
import './Header.css';

export default () => {
    return(
        <header className="black">
            <div className="header--logo">
                <a href="/">
                    <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Netflix_2015_logo.svg/799px-Netflix_2015_logo.svg.png" alt="Netflix"/>
                </a>
                <div className="header--user">
                <a href="/">
                    <img src="https://ih0.redbubble.net/image.618427277.3222/flat,1000x1000,075,f.u2.jpg"/>
                </a>
                </div>
            </div>
        </header>
    );
}
